-- SUBSAMPLING TABLE 'acsData' ---

 -- Insert subset into destination table
 TRUNCATE TABLE [SkyNode_GALEXGR6_STAT].[dbo].[acsData];

 GO
 -- Create temporary table for the random ID list
 IF EXISTS( SELECT * FROM tempdb.dbo.sysobjects WHERE ID = OBJECT_ID(N'tempdb..##temporaryidlist'))
 DROP TABLE ##temporaryidlist;
 GO

 CREATE TABLE ##temporaryidlist
 (
	[eclipse_num] int, [target_id] varchar(32), [offset_secs] float
 );
 
 -- Collect IDs
 WITH temporaryidlistquery AS
 (
	SELECT sourcetablealias.[eclipse_num], sourcetablealias.[target_id], sourcetablealias.[offset_secs], gw.RandomDouble() AS randomnumber
	FROM [SkyNode_GALEXGR6].[dbo].[acsData] sourcetablealias
	
 )
 INSERT ##temporaryidlist WITH (TABLOCKX)
 SELECT [eclipse_num], [target_id], [offset_secs]
 FROM temporaryidlistquery
 WHERE randomnumber < 0.1;
 
 -- Insert subset into destination table
 
 INSERT [SkyNode_GALEXGR6_STAT].[dbo].[acsData] WITH (TABLOCKX)
	([eclipse_num], [target_id], [offset_secs], [mode], [ra], [dec], [twist], [omegax], [omegay], [cx], [cy], [cz], [htmId], [zoneId])
 SELECT sourcetablealias.[eclipse_num], sourcetablealias.[target_id], sourcetablealias.[offset_secs], sourcetablealias.[mode], sourcetablealias.[ra], sourcetablealias.[dec], sourcetablealias.[twist], sourcetablealias.[omegax], sourcetablealias.[omegay], sourcetablealias.[cx], sourcetablealias.[cy], sourcetablealias.[cz], sourcetablealias.[htmId], sourcetablealias.[zoneId]
 FROM   [SkyNode_GALEXGR6].[dbo].[acsData] sourcetablealias WITH (NOLOCK)
	INNER JOIN ##temporaryidlist ON ##temporaryidlist.[eclipse_num] = sourcetablealias.[eclipse_num] AND ##temporaryidlist.[target_id] = sourcetablealias.[target_id] AND ##temporaryidlist.[offset_secs] = sourcetablealias.[offset_secs]
	;


